    false,nt"url": null,nt"notes": "This narrative report for Stillwater WMA
    (including Stillwater NWR, Anaho Island, Fallon NWR, and Winnemucca NWR) outlines
    Refuge accomplishments from January through April of 1952. The report begins by
    summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, furbearers, predators, raptors, and
    fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and wildfires. Resource management is outlined;
    topics include grazing and fur harvesting. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, and Refuge participation. N-R forms
    and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
